        "x86_64-darwin",
        "x86_64-linux"
      ],
      "allow": {
        "licenses": []
      },
      "semver": {}
    },
    "services": {
      "dagger-engine": {
        "command": "docker run --rm --privileged $_DE_ARGS $DAGGER_ENGINE_IMAGE"
      }
    }
